import './Cl.css';
import magic from './image/magic main.png'
import logo from './image/Grup.png'
import logo1 from './image/black wight.png'
import logo2 from './image/blue.png'
import logo3 from './image/jen.main.png'
// import logo4 from './image/'
// import logo5 from './image/'
// import logo6 from './image/'
import { Component } from "react";

class Cl  extends Component
{
    render(){
               
         return(
        <>  
           <div className="navbar">
                <a href="Setrvices">Services</a>
                <a href="countact us.html">Contact</a>
                <a href="About">About</a>
                <a href="Home">Home</a>
                <img src={magic} className='magic'/>
                <h1>d</h1>
                
              
            </div> 
            <img src={logo} className='data'/>
            <div className='scroll'>

            <img src={logo1} alt="" className='f1'/>
            <img src={logo2} alt="" className='f1'/>
            <img src={logo3} alt="" className='f1 f2'/>
            {/* <img src={logo4} alt=""/>
            <img src={logo5} alt=""/>
            <img src={logo6} alt=""/> */}

            </div>
              </> )
        }   
    }
export default Cl
